// UserProfile.js

import React from "react";
import { useLocation } from "react-router-dom";

const UserProfile = () => {
  const location = useLocation();
  const { Data } = location.state;

  return (
    <div>
      <h2>User Profile</h2>
      <img src={Data.photo_url} height="250px" width="250px" />
      <p>Roll Number: {Data.roll_number}</p>
      <p>Student Name: {Data.student_name}</p>
      <p>Email id: {Data.email_id}</p>
      <p>address: {Data.address}</p>
      <p>contact_number :{Data.contact_number}</p> "9566564687" created_at :
      "2024-03-02T10:29:29.591Z" email_id : "jonnys.exaple@gmail.com" photo_url
      :
      "https://www.meme-arsenal.com/memes/e608f11411e119099876514fab3098a5.jpg"
      roll_number : "23275001" school_of_study : "ADT" student_name : "Jonny S"
      year_of_admission : 2023
    </div>
  );
};

export default UserProfile;
